"""Now let’s define the distribution of distributions :"""

def distribution2(x):
    # return probability given a value
    d = (x**2*np.exp(-(x-2)**2))/(5*np.sqrt(2*np.pi))
    return d
    
def distribution(mu=0, sigma=1):
    # return probability given a value
    d = stats.norm(mu, sigma)
    return d   

def distribution3(mu=2, sigma=1):
    # return probability given a value
    d = stats.norm(2, 1)
    return d  

def distribution4(m=5, s=1):
    # return probability given a value
    d = stats.gamma( a=5, scale=3)
    return d

