import numpy as np
import matplotlib.pyplot as plt
# Parameters
# drift coefficent
mu = 0.1
# number of steps
n = 12
# time in years
T = 1
# number of sims
M = 5000
# initial stock price
S0 = 1
# volatility
sigma = 0.5
#interest rate
r = 0.05

# calc each time step
dt = T/n
# simulation using numpy arrays
St = np.exp(
    (mu - sigma ** 2 / 2) * dt
    + sigma * np.random.normal(0, np.sqrt(dt), size=(M,n)).T
)
# include array of 1's
St = np.vstack([np.ones(M), St])
# multiply through by S0 and return the cumulative product of elements along a given simulation path (axis=0). 
St = S0 * St.cumprod(axis=0)

"""Here St is the Path of the Geometric Brownian Motion.

2.b
"""

# Define time interval correctly 
time = np.linspace(0,T,n+1)
# Require numpy array that is the same shape as St
tt = np.full(shape=(M,n+1), fill_value=time).T
plt.plot(tt, St)
plt.xlabel("Years $(t)$")
plt.ylabel("Stock Price $(S_t)$")
plt.title(
    "Realizations of Geometric Brownian Motion\n $dS_t = \mu S_t dt + \sigma S_t dW_t$\n $S_0 = {0}, \mu = {1}, \sigma = {2}$".format(S0, mu, sigma)
)
plt.show()

K = [1.1, 1.2, 1.3, 1.4, 1.5]

for strike_price in range(len(K)):
  n,m = np.shape(St) 
  sum = np.zeros(m)
  prod = np.ones(m)
  for i in range(m):
    for j in range(n):
      sum[i]+=St[j][i]
      prod[i]*=St[j][i]
    sum[i] = sum[i]/n
    prod[i] = prod[i]**(1/n)

  Pa = np.exp(-r)*np.maximum(sum -K[strike_price],0)
  Pg = np.exp(-r)*np.maximum(prod -K[strike_price],0)
  Pe = np.maximum(St[-1]-K[strike_price], 0)*np.exp(-r)
  print(f'K = {K[strike_price]}\n')
  print(f'Corr Pa x Pg    {np.corrcoef(Pa, Pg)[0,1]}\n\n')
  print(f'Corr Pa x Pe    {np.corrcoef(Pa, Pe)[0,1]}\n\n')
  print(f'Corr Pa x S(T)  {np.corrcoef(Pa, St[-1])[0,1]}\n\n')

"""**K incraeses the Correlation between Pa, Pg, S(T) (with each of them) decreases, and the correlation between Pa and Pg suffered the least decrease in corr while corr between Pa and S(T) suffered the most**"""